import React, { useState } from 'react';

function ClienteForm() {
    const [campo1, setCampo1] = useState('');
    const [campo2, setCampo2] = useState('');
    // Repite esto para los otros 19 campos

    const handleCampo1Change = (e) => {
        setCampo1(e.target.value);
    };
    const handleCampo2Change = (e) => {
        setCampo2(e.target.value);
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Envía los datos del formulario o realiza cualquier otra acción necesaria
    };

    return (
        <form onSubmit={handleSubmit}>
            <p>
                <input type="submit" value="Guardar" />&nbsp;
                <input type="submit" value="Borrar" />&nbsp;
                <input type="reset" value="Limpiar" />&nbsp;
            </p>
            <h4>Información general</h4>
            <p>
                <div >
                    <label for="name">Nombre</label>
                    <input type="text" name="nombre" size="30" />&nbsp;
                </div>
                <div >
                    <label for="name">Apellido paterno</label>
                    <input type="text" name="apellidoP" size="30" />&nbsp;
                </div>
                <div>
                    <label for="name">Apellido materno</label>
                    <input type="text" name="apellidoA" size="30" />&nbsp;
                </div>
                <div >
                    <label for="name">Fecha registro</label>
                    <input type="date" name="fechaRegistro" size="20" />
                </div>
            </p>
            <br></br>
            <p>

                <div style={{ float: 'left', marginRight: '20px' }}>
                    <label for="name">Fecha nacimiento:</label>
                    <input type="tedatext" name="fechaNacimiento" size="30" />&nbsp;
                </div>
                <div style={{ float: 'left', marginRight: '20px' }}>
                    <label for="name">Lugar nacimiento:</label>
                    <input type="text" name="lugarNacimiento" size="30" />&nbsp;
                </div>
                <div style={{ float: 'left', marginRight: '20px' }}>
                    <label for="name">Estado civil:</label>
                    <select name="estadoCivil" id="estadoCivil" >
                        <option value="0"></option>
                        <option value="S">Soltero</option>
                        <option value="C">Casado</option>
                        <option value="D">Divorciado</option>
                        <option value="V">Viudo</option>
                    </select>&nbsp;
                </div>
                <div style={{ float: 'left', marginRight: '20px' }}>
                    <label for="name">Edad:</label>
                    <input type="number" name="edad" size="30" min="50" max="200" />
                </div>
            </p>
            <p>
                NSS: <input type="number" name="nss" size="30" />&nbsp;
                CURP: <input type="text" name="curp" size="30" />&nbsp;
                RFC: <input type="text" name="rfc" size="30" />
            </p>
            <h4>Dirección</h4>
            <p>Estado: <select name="estado" id="estado">
                <option value="0"></option>
                <option value="S">Michoacan</option>
                <option value="C">Jalisco</option>
                <option value="D">Colima</option>
                <option value="V">Gerrero</option>
            </select>&nbsp;
                Ciudad: <input type="text" name="ciudad" size="30" />&nbsp;
                Colonia: <input type="text" name="colonia" size="30" />&nbsp;
                Código postal : <input type="text" name="cp" size="20" maxlength="5" />
            </p>
            <p>
                Calle: <input type="text" name="calle" size="30" />&nbsp;
                Numero : <input type="number" name="numero" size="20" min="1" />
            </p>
            <h4>Datos de contacto</h4>
            <p>
                Teléfono Casa: <input type="tel" name="telefono" size="30" />&nbsp;
                Teléfono Celular : <input type="tel" name="celular" size="30" />&nbsp;
                Email : <input type="email" name="email" size="30" />
            </p>
            {/*
            <input type="text" value={campo1} onChange={handleCampo1Change} />
            <input type="text" value={campo2} onChange={handleCampo2Change} />
            <button type="submit">Enviar</button>
    */}
        </form>
    );
}

export default ClienteForm;
